import './App.css';
import Selector from "./components/selector"
import GetRadon from "./components/GetData"
import Test from "./components/test"

function App() {
  return (
    <div className="App">
      <div>
        <Selector />
      </div>
      <Test />
      <div>
        <GetRadon />
      </div>
    </div>
  );
}

export default App;
